InformantLocalizations["csCZ"]["Welcome"] = "|c40ff50ffVitej v informantu|r Protoze toto je poprve kdy pouzivas Informant, zobrazuje se tato zprava jako upozorneni ze musis v sekci \"|cffffffffKeybindings|r\" v \"|cffffffffGame Menu|r\" nastavit klavesu kterou budes zozrazovat toto okno. K zobrazeni dodatecnych informaci pote staci najet mysi na predmet ktery te zajima a stisknout nastavenou klavesu. Zobrazi se toto okno s informacemi o vybranem predmetu. Dalsim stisknutim nastavene klavesy nebo kliknutim na krizek okno zavres. Nyni klikni na krizek."
InformantLocalizations["daDK"]["Welcome"] = "|c40ff50ffVelkommen til Informant|r Da det er f\195\184rste gang du bruger Informant, f\195\165r du denne besked for at fort\195\166lle at du b\195\184r lave en tastaturgenvej i |cffffffffKeybindings|r sektionen i |cffffffffGame Menu|rFra det \195\184jeblik kan du vise udvidet information om dine ting, ved at pege musen p\195\165 tingen og derefter trykke p\195\165 den valgte tast. S\195\165 vil dette vindue komme frem med alle mulige informationer som er v\195\166rd at vide. For at fjerne vinduet trykker du p\195\165 tasten igen eller klikker p\195\165 Close knappen."
InformantLocalizations["deDE"]["Welcome"] = "|c40ff50ffWillkommen bei Informant|r Da Sie Informant das erste Mal nutzen erscheint diese Nachricht, um Ihnen mitzuteilen, dass sie eine Taste belegen m\195\188ssen, um dieses Fenster innerhalb der |cffffffffTastaturbelegung|r Sektion des |cffffffffHauptmen\195\188|r anzeigen zu lassen. Um erweiterte Informationen \195\188ber Gegenst\195\164nde in ihrem Inventar zu erhalten, m\195\188ssen sie die Maus \195\188ber den gew\195\188nschten Gegenstand bewegen und die von Ihnen gew\195\164hlte Taste dr\195\188cken und es erscheint ein Fenster mit Informationen \195\188ber diesen Gegenstand. Zum Schliessen des Fensters bet\195\164tigen sie die Taste erneut oder sie dr\195\188cken den Schliessen Button dieses Fensters. Zum Fortfahren dr\195\188cken sie bitte den Schliessen-Button."
InformantLocalizations["enUS"]["Welcome"] = "|c40ff50ffWelcome to Informant|r\n\nSince this is the first time you are using Informant, this message appears to let you know that you must set a key to show this window from within the |cffffffffKeybindings|r section of the |cffffffffGame Menu|r.\n\nFrom then on to view advanced information about items in your inventory, simply move your mouse over the item you want to see information about and press the key that you bound, and this window will popup, filled with information about that item.\n\nAt that point, simply press the key again, or click the close button on this frame.\n\nClick the close button now to continue."
InformantLocalizations["esES"]["Welcome"] = "|c40ff50ffBienvenido a Informant|r\n\nYa que esta es la primera vez que usted usa\n\nInformant, este mansaje aparece para dejarle saber que usted debe de designar una tecla desde dentro de la secci\195\179n de \"|cffffffffKeybindings|r\" del \"|cffffffffGame Menu|r\" del juego para hacer aparecer esta ventana.\n\nDesde ese punto en adelante, para ver informaci\195\179n avanzada de los art\195\173\194\173culos en su inventario, simplememnte mueva su mouse sobre el art\195\173\194\173culo del cual quiera ver la informaci\195\179n y oprima la tecla que usted escogio, y esta ventana aparecer\195\161, llena con informaci\195\179n sobre ese art\195\173\194\173culo.\n\nCuando quiera cerrar la ventana, simplemente oprime la tecla de nuevo o presione el bot\195\179n de \"Close\" para cerrarla.\n\nPresione el bot\195\179n de \"Close\" para continuar."
InformantLocalizations["frFR"]["Welcome"] = "|c40ff50ffBienvenue dans Informant|r Comme c'est la premi\195\168re fois que vous utilisez Informant, ce message appara\195\174t pour vous faire savoir qu'il est n\195\169cessaire d'attribuer une touche pour afficher cette fen\195\170tre. Ceci se fait dans le menu |cffffffffRaccourcis|r du |cffffffffMenu g\195\169n\195\169ral|r. Ceci fait, pour voir les informations d\195\169taill\195\169es des objets de votre inventaire, il suffit de placer votre curseur souris sur un objet qui vous int\195\169resse et d'appuyer sur la touche que vous avez attribu\195\169e, cette fen\195\170tre appara\195\174tra alors avec les informations souhait\195\169es. Pour fermer la fen\195\170tre, appuyer sur la touche de nouveau, ou cliquer sur le bouton de fermeture de la fen\195\170tre. Cliquer sur le bouton de fermeture maintenant pour continuer."
InformantLocalizations["itIT"]["Welcome"] = "|c4Off5OffBenvenuto su Informant|r Questa e' la prima volta che usi Informant, devi quindi bindare un tasto in |cffffffffKeybindings|r del |cffffffffGame Menu|r. Da questo punto in poi per vedere le informazioni supplementari di un oggetto, muovi il mouse su di esso e primi il tasto che hai 'bindato'; questa finestra apparira' con le informazioni aggiuntive. Premi il tasto di nuovo per chiudere la finestra."
