InformantLocalizations["nlNL"]["Welcome"] = "|c40ff50ffWelkom bij Informant|r Aangezien dit de eerste keer is dat Informant gebruikt wordt, verschijnt deze melding om te laten weten dat er een toets ingesteld moet worden in het |cffffffffKeybinding-sectie|r van het |cffffffffGame Menu|r voor dit scherm. Vanaf dat moment dient, om uitgebreide informatie over je items in je inventaris te zien, de muis bewogen te worden over het item waarover informatie benodigd is en wanneer dan op de ingestelde toets gedrukt wordt zal een scherm verschijnen met informatie over dat item. Op dat moment, druk de toets nogmaals, of klik op Close. Klik op op de Close-toets om verder te gaan. "
